pragma solidity ^0.5.0;

contract realIdService {
   string driverid;
   string address1;
   string address2;

function setRealIdChange(string memory _driverid, string memory _address1,string memory _address2) public {
      driverid = _driverid;
      address1 = _address1;
      address2 = _address2;
      
   }
   
   function getRealIdChange() public view returns (string memory,string memory,string memory) {
       return ( driverid,address1,address2);
   
   }
    
}
